import React, { useState, useEffect } from 'react';
import { RotateCcw } from 'lucide-react';

function App() {
  const [activeFeatures, setActiveFeatures] = useState({
    metronome: false,
    pulse: false,
    ventilation: false,
    epi: false
  });
  const [seconds, setSeconds] = useState(0);
  const [timerInterval, setTimerInterval] = useState(null);

  // Start/stop the timer based on active features
  useEffect(() => {
    const anyActive = Object.values(activeFeatures).some(Boolean);

    if (anyActive && !timerInterval) {
      // Start timer
      const interval = setInterval(() => {
        setSeconds(prev => prev + 1);
      }, 1000);
      setTimerInterval(interval);
    } else if (!anyActive && timerInterval) {
      // Stop timer
      clearInterval(timerInterval);
      setTimerInterval(null);
    }

    return () => {
      if (timerInterval) clearInterval(timerInterval);
    };
  }, [activeFeatures, timerInterval]);

  // Simple reset function
  const resetAll = () => {
    // Clear timer
    if (timerInterval) {
      clearInterval(timerInterval);
      setTimerInterval(null);
    }

    // Reset all state
    setActiveFeatures({
      metronome: false,
      pulse: false,
      ventilation: false,
      epi: false
    });
    setSeconds(0);
  };

  // Format time as MM:SS
  const formatTime = (totalSeconds) => {
    const minutes = Math.floor(totalSeconds / 60);
    const seconds = totalSeconds % 60;
    return `${minutes.toString().padStart(2, '0')}:${seconds.toString().padStart(2, '0')}`;
  };

  return (
    <div style={{ padding: '20px', backgroundColor: '#1e2126', minHeight: '100vh', color: 'white' }}>
      <div style={{ fontSize: '48px', textAlign: 'center', margin: '20px 0' }}>
        {formatTime(seconds)}
      </div>

      {/* Feature buttons */}
      <div style={{ display: 'flex', justifyContent: 'center', gap: '10px', margin: '20px 0' }}>
        <button 
          onClick={() => setActiveFeatures(prev => ({ ...prev, metronome: !prev.metronome }))}
          style={{ 
            padding: '10px 20px', 
            backgroundColor: activeFeatures.metronome ? '#3498db' : '#2c3e50',
            border: 'none',
            borderRadius: '4px',
            color: 'white'
          }}
        >
          Metronome
        </button>

        <button 
          onClick={() => setActiveFeatures(prev => ({ ...prev, pulse: !prev.pulse }))}
          style={{ 
            padding: '10px 20px', 
            backgroundColor: activeFeatures.pulse ? '#3498db' : '#2c3e50',
            border: 'none',
            borderRadius: '4px',
            color: 'white'
          }}
        >
          Pulse Check
        </button>

        <button 
          onClick={() => setActiveFeatures(prev => ({ ...prev, ventilation: !prev.ventilation }))}
          style={{ 
            padding: '10px 20px', 
            backgroundColor: activeFeatures.ventilation ? '#2ecc40' : '#2c3e50',
            border: 'none',
            borderRadius: '4px',
            color: 'white'
          }}
        >
          Ventilation
        </button>

        <button 
          onClick={() => setActiveFeatures(prev => ({ ...prev, epi: !prev.epi }))}
          style={{ 
            padding: '10px 20px', 
            backgroundColor: activeFeatures.epi ? '#ff4136' : '#2c3e50',
            border: 'none',
            borderRadius: '4px',
            color: 'white'
          }}
        >
          Epinephrine
        </button>
      </div>

      {/* Reset button */}
      <ResetButton onReset={resetAll} />
    </div>
  );
}

// Reset Button Component
const ResetButton = ({ onReset }) => {
  const [showConfirm, setShowConfirm] = useState(false);

  const handleResetClick = () => {
    if (!showConfirm) {
      setShowConfirm(true);
      setTimeout(() => setShowConfirm(false), 3000);
    } else {
      onReset();
      setShowConfirm(false);
    }
  };

  return (
    <button
      onClick={handleResetClick}
      style={{
        position: 'fixed',
        bottom: '20px',
        right: '20px',
        borderRadius: '50%',
        width: '48px',
        height: '48px',
        backgroundColor: showConfirm ? '#ff4136' : '#2c3e50',
        color: '#ffffff',
        border: 'none',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        boxShadow: '0 2px 6px rgba(0,0,0,0.3)',
        cursor: 'pointer',
        zIndex: 1000
      }}
    >
      <RotateCcw size={24} />
      {showConfirm && (
        <div style={{
          position: 'absolute',
          top: '-40px',
          right: '0',
          backgroundColor: '#ff4136',
          color: '#ffffff',
          padding: '4px 8px',
          borderRadius: '4px',
          fontSize: '12px',
          whiteSpace: 'nowrap'
        }}>
          Tap again to reset all
        </div>
      )}
    </button>
  );
};

export default App;
